style.css:
body {
    background: linear-gradient(#7788A6, #7788A6, #C7C5CF, #434454); /* Body background color */
    font-family: 'Arial', sans-serif;
    color: #333;
}

header {
    background: linear-gradient(#7788A6, #7788A6, #C7C5CF, #434454), url('https://i.pinimg.com/474x/52/cd/c2/52cdc202d363c790f5d2dc99d015e37c.jpg');
    background-size: cover;
    background-position: center;
    color: #DCDBE3;
    padding: 10px 20px;
    text-align: center;
}

nav {
    background-color: #C7C5CF; /* Navigation background color */
}

nav ul {
    list-style-type: square;
    list-style-position: outside;
    margin: 0 10px;
}

nav a {
    text-decoration: none;
    color: #C7C5CF;
}

main {
    padding: 20px;
}

footer {
    background-color: #434454; /* Footer background color */
    color: #434454;
    text-align: center;
    padding: 10px 20px;
}
